window.bookSummaryJSON = "<p><b>Doomed Valley… a place of legend and death where most who enter never escape.</b></p> <p>Kaylia and Brokk are determined to uncover the mysteries of the Valley and retrieve the crudue vine necessary to save Lexi’s life. They’re prepared for the worst, but they’re not ready for the many horrors of the Valley, the undeniable attraction rising between them, or the whispers haunting their journey.</p> <p><b>Whispers that will bide their time before unleashing their deadly truth.</b></p> <p><b>Return to the Shadow Realms. A world where vampires feast, lycans love deeply, dark fae seduce, witches cast their spells, dragons rule the skies... and treachery lurks around every corner.</b></p> <p><i>***Due to sexual content, violence, and language, this book is recommended for listeners 18+ years of age.***</i></p>"; 
